/**
 * A "placeholder" is a region on the page where client-side components can inject
 * custom content.
 * @remarks
 * For more information about placeholders, see {@link PlaceholderProvider}.
 *
 * @beta
 */
declare enum PlaceholderName {
    /**
     * Placeholder that exists on the top of the page.
     * @internalremarks
     * Used by Modern pages and Lists and libraries
     */
    Top = 1,
    /**
     * Placeholder that exists on the bottom of the page.
     * @internalremarks
     * Used by Modern pages and Lists and libraries
     */
    Bottom = 2,
}
export default PlaceholderName;
